import React from 'react';

function Footer() {
    return (
        <div>
                <footer className="footer">
                    <div className="footer__container">
                        <p className="footer__copyright">&copy; 2020 Around The U.S.</p>
                    </div>
                </footer>
        </div>
    );
}

export default Footer;
